import {getName} from '../utils/common';
import TextInput from '../components/commons/baseText';
interface Props {
    type : string,
    count : number
}
export default function Title({type, count} : Props){
    return (
        <div className='pl-[90px] w-full mt-8 font_base'>
            <div className='w-full px-4 '>
                <p className='font-bold'>{getName(type)}</p>
                <div className='flex w-full'>
                    <div className='basis-1/2'>
                        <p>총 : {count}건</p>
                    </div>
                    <div className='basis-1/2 flex'>
                        <TextInput type={'cmpk'} classnames={'w-[120px]'} text={'고객키'}/>
                        <TextInput type={'name'} classnames={'w-[60px]'} text={'이름'}/>
                        <TextInput type={'cCell'} classnames={'w-[120px]'} text={'핸드폰'}/>
                        <TextInput type={'birth'} classnames={'w-[100px]'} text={'생년월일'}/>
                    </div>
                </div>
            </div>
        </div>
    )
}
